Defendant Tracey Annette Blue in court with attorney Bridget Joy Krause.  Defendant Tracey Annette Blue in custody.  Jeremy R. Arn appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

COUNT 1:  The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty.  On state's motion the penalty enhancer "REPEATER" DISMISSED.

The Court ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting. 

Sentencing proceeded.  Statements made by State, defense and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of  3 1/2 YEARS, CONSECUTIVE to any other time being served with credit for 47 days. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program or the Substance Abuse Program.  The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION (if revoked):
*Referral to Mental health unit of probation department;
*Obtain Mental health assessment-if necessary complete follow-up care/treatment-if prescribed medication take only in manner as prescribed by physician;
*Obtain AODA assessment and complete follow-up care/treatment;
*Cooperate with random urine screens;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No contact with victim Walmart located at 222 N. Chicago Ave., South Milwaukee and Macy's located at Mayfair Mall;
*Pay all supervision fees;
*Provide DNA sample if not previously done so- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment;

State in compliance with victim rights legislation.  The Court ordered restitution in the stipulated amount of $35.53 payable to Walmart (15CM725)-to be paid first and by the end of probation period or balance to convert to civil judgment.  If revoked, the Court ordered all financial obligations and restitution to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Defendant is informed she may not possess and/or own any firearms.  Defendant is informed she may not vote in any election until her civil rights have been reinstated.  Appeal rights given. 
